import React, { memo } from 'react';
import styled from 'styled-components';

const PayBtn = styled.div`
       font-size: 14px;
    font-weight: 700;
    width: 80%;
    color: white;
    margin: auto;
    background-color: #4c4747;
    text-align: center;
    padding: 25px 17px;
    border-radius: 5px;
`;
const PayButton = memo(() => {
    return (
        <PayBtn>
            결제하기
        </PayBtn>
    );
});

export default PayButton;
